request.description:
## HTTP REQUEST
```
GET /networks/[networkId]/alertSettings
```

## PARAMETERS
**None**

### SAMPLE REQUEST
```
curl -L -H 'X-Cisco-Meraki-API-Key: <key>' -H 'Content-Type: application/json' -X GET 'https://api.meraki.com/api/v0/networks/[networkId]/alertSettings'
```

### SAMPLE RESPONSE
```
Successful HTTP Status: 200
{
  "defaultDestinations": {
    "emails": [
      "miles@meraki.com"
    ],
    "allAdmins": true,
    "snmp": true
  },
  "alerts": [
    {
      "type": "gatewayDown",
      "enabled": true,
      "alertDestinations": {
        "emails": [
          "miles@meraki.com"
        ],
        "allAdmins": false,
        "snmp": false
      },
      "filters": {
        "timeout": 60
      }
    }
  ]
}
```

